import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import SearchInput from '../components/SearchInput';
import { Calendar, UserPlus, ChevronDown, Plus, X } from 'lucide-react';
import { useTheme } from '../styles/ThemeContext';

const HomePage = () => {
  const [selectedDestinations, setSelectedDestinations] = useState([]);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [tripType, setTripType] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();
  const { darkMode } = useTheme();

  const handleDestinationSelect = (destination) => {
    if (selectedDestinations.length < 5 && !selectedDestinations.some(d => d.name === destination.name)) {
      setSelectedDestinations([...selectedDestinations, destination]);
      setError('');
    }
  };

  const removeDestination = (index) => {
    const newDestinations = [...selectedDestinations];
    newDestinations.splice(index, 1);
    setSelectedDestinations(newDestinations);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (selectedDestinations.length === 0) {
      setError('Choose at least one destination to start planning');
      return;
    }
    const planId = Math.random().toString(36).substring(2, 15);
    const planData = {
      destinations: selectedDestinations,
      startDate,
      endDate,
      tripType
    };
    navigate(`/plan/${planId}`, { state: planData });
  };

  return (
    <div className={`tinoto-page ${darkMode ? 'dark-mode' : ''}`}>
      <h1 className="tinoto-main">Plan a new trip</h1>
      <p className="tinoto-subtitle">Start your journey with Tinoto</p>
      <form onSubmit={handleSubmit} className="tinoto-form">
        <div className="tinoto-form-group">
          <label htmlFor="destination" className="tinoto-label">Where to?</label>
          <div className="tinoto-destinations-input">
            {selectedDestinations.map((dest, index) => (
              <div key={index} className="tinoto-selected-destination">
                {dest.name}
                <button 
                  type="button" 
                  className="tinoto-remove-destination" 
                  onClick={() => removeDestination(index)}
                >
                  <X size={16} />
                </button>
              </div>
            ))}
            {selectedDestinations.length < 5 && (
              <div className="tinoto-destination-search">
                <SearchInput 
                  id="destination"
                  placeholder="e.g. Paris, Hawaii, Japan" 
                  onSelect={handleDestinationSelect}
                />
                {selectedDestinations.length > 0 && (
                  <button type="button" className="tinoto-add-destination">
                    <Plus size={16} />
                  </button>
                )}
              </div>
            )}
          </div>
          {error && <p className="tinoto-error">{error}</p>}
        </div>

        <div className="tinoto-form-group">
          <label className="tinoto-label">Dates (optional)</label>
          <div className="tinoto-date-inputs">
            <div className="tinoto-date-input">
              <Calendar size={18} />
              <input 
                type="date" 
                placeholder="Start date" 
                value={startDate}
                onChange={(e) => setStartDate(e.target.value)}
              />
            </div>
            <div className="tinoto-date-input">
              <Calendar size={18} />
              <input 
                type="date" 
                placeholder="End date" 
                value={endDate}
                onChange={(e) => setEndDate(e.target.value)}
              />
            </div>
          </div>
        </div>

        <div className="tinoto-form-group tinoto-flex tinoto-justify-between tinoto-items-center">
          <button type="button" className="tinoto-button-secondary">
            <UserPlus size={18} />
            Invite tripmates
          </button>
          <div className="tinoto-dropdown">
            <select 
              className="tinoto-select" 
              value={tripType} 
              onChange={(e) => setTripType(e.target.value)}
              required
            >
              <option value="">Trip type</option>
              <option value="friends">Friends</option>
              <option value="family">Public</option>
              <option value="couple">Private</option>
            </select>
          </div>
        </div>

        <div className="tinoto-form-group tinoto-text-center">
          <button type="submit" className="tinoto-button-primary">Start planning</button>
        </div>
      </form>
      <p className="tinoto-text-center">
        Or <Link to="/write-guide" className="tinoto-link">write a new guide</Link>
      </p>
    </div>
  );
};

export default HomePage;
